import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const navigate = useNavigate();
  const [teachers, setTeachers] = useState([]);
  const [newTeacher, setNewTeacher] = useState({ name: '', email: '', password: '' });

  const fetchTeachers = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/teachers');
      setTeachers(res.data);
    } catch (err) {
      alert('Error fetching teachers');
    }
  };

  useEffect(() => {
    fetchTeachers();
  }, []);

  const handleAddTeacher = async (e) => {
    e.preventDefault();
    const { name, email, password } = newTeacher;

    if (!email.endsWith('@msrit.edu')) {
      alert('Please enter a valid @msrit.edu email address');
      return;
    }

    try {
      await axios.post('http://localhost:5000/api/teachers', { name, email, password });
      alert('Teacher added');
      setNewTeacher({ name: '', email: '', password: '' });
      fetchTeachers();
    } catch (err) {
      alert(err.response?.data?.message || 'Error adding teacher');
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('Are you sure you want to delete this teacher?')) return;
    try {
      await axios.delete(`http://localhost:5000/api/teachers/${id}`);
      alert('Teacher deleted');
      fetchTeachers();
    } catch (err) {
      alert('Error deleting teacher');
    }
  };

  return (
    <div className="admin-dashboard-page">
      <img src="https://d2e9h3gjmozu47.cloudfront.net/brand.png" alt="Logo" className="admin-logo" />

      {/* ✅ Top-Right Button */}
      <div className="top-right-btn">
        <button className="go-to-login-btn" onClick={() => navigate('/admin-login')}>
          Go to Teacher Login
        </button>
      </div>

      <div className="admin-dashboard-wrapper">
        {/* Add Teacher Form */}
        <form className="admin-form-card" onSubmit={handleAddTeacher}>
          <h2>Add New Teacher</h2>
          <input
            type="text"
            placeholder="👤 Name"
            value={newTeacher.name}
            onChange={(e) => setNewTeacher({ ...newTeacher, name: e.target.value })}
            required
          />
          <input
            type="email"
            placeholder="📧 Email"
            value={newTeacher.email}
            onChange={(e) => setNewTeacher({ ...newTeacher, email: e.target.value })}
            required
          />
          <input
            type="password"
            placeholder="🔒 Password"
            value={newTeacher.password}
            onChange={(e) => setNewTeacher({ ...newTeacher, password: e.target.value })}
            required
          />
          <button type="submit">Add Teacher</button>
        </form>

        {/* Teachers List */}
        <div className="admin-table-card">
          <h2>All Teachers</h2>
          {teachers.length === 0 ? (
            <p className="no-teachers">No teachers found.</p>
          ) : (
            <table>
              <thead>
                <tr>
                  <th></th>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {teachers.map((teacher) => (
                  <tr key={teacher._id}>
                    <td><div className="teacher-avatar">👤</div></td>
                    <td>{teacher.name}</td>
                    <td>{teacher.email}</td>
                    <td>
                      <button onClick={() => handleDelete(teacher._id)} className="delete-btn">
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
